import React from 'react'
import "./Support.css"
import {SupportType} from '../../../SignworksJSON'

export default function Support(props) {
  //console.log('props', props)
  const SBT = new SupportType();
  console.log('incoming base', props.sel?SBT.name(props.sel.attributes.SUPPORTTYPE):'null ')
 
  return (
    
    <div className="Support">
         <p>
        { props.sel?SBT.name(props.sel.attributes.SUPPORTTYPE):'null '}
         </p>
    </div>
  )
}
